// import React from 'react'
import React, { useState } from "react";
// import { useDispatch } from "react-redux";
import { Link, useNavigate } from "react-router-dom";
import TermsandCondition from "../UserProfile/TermsandCondition";

const Signup = () => {

    const [formData, setFormData] = useState({
        name: "",
        email: "",
        phone_number: "",
      });
      const navigate = useNavigate();
      const [accepted, setAccepted] = useState(false);
    //   const dispatch = useDispatch();
      const [alertMessage, setAlertMessage] = useState("");
      const [showAlert, setShowAlert] = useState(false);
    
      const handleChange = (e) => {
        const { id, value } = e.target;
        setFormData((prevData) => ({
          ...prevData,
          [id]: value,
        }));
      };
    
      const handleSubmit = async (e) => {
        e.preventDefault();
      
        // Check for empty fields
        if (!formData.name || !formData.email || !formData.phone_number) {
          setAlertMessage("Please fill out all fields.");
          setShowAlert(true);
      
          // Hide alert after 5 seconds
          setTimeout(() => setShowAlert(false), 5000);
          return; // Exit early if fields are empty
        }
    
        formData.email= formData?.email.toLowerCase()
      
        try {
          // Dispatch the createinfluencers action
        //   await dispatch(createinfluencers(formData));
    
          navigate("/signin")
      
          // No need to show component's alert, API will handle notifications
        } catch (error) {
          // Optionally log the error for debugging
          console.error("API Error:", error);
      
          // No need to show error alert, API will handle notifications
        }
      };
  return (
<div className="min-h-screen flex items-center justify-center bg-blue-50 px-4 py-6 relative">
  {/* Alert */}
  {showAlert && (
    <div className="absolute top-5 w-full max-w-sm">
      <div
        className={`${
          alertMessage.includes("successfully")
            ? "bg-green-200 border-green-400 text-green-800"
            : "bg-red-200 border-red-400 text-red-800"
        } border p-4 rounded-lg shadow-lg`}
      >
        <p className="font-semibold">
          {alertMessage.includes("successfully") ? "Success" : "Error"}
        </p>
        <pre className="whitespace-pre-wrap text-sm">{alertMessage}</pre>
      </div>
    </div>
  )}

  <div className="w-full max-w-lg bg-white p-8 rounded-xl shadow-2xl">
    <h2 className="text-3xl font-bold text-blue-600 text-center mb-8">
      Create Your Account
    </h2>
    <form onSubmit={handleSubmit}>
      {/* Name Field */}
      <div className="mb-6">
        <label
          htmlFor="name"
          className="block text-sm font-medium text-gray-700"
        >
          Full Name
        </label>
        <input
          type="text"
          id="name"
          value={formData.name}
          onChange={handleChange}
          className="w-full mt-2 p-3 border border-gray-300 rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
          placeholder="John Doe"
        />
      </div>

      {/* Email Field */}
      <div className="mb-6">
        <label
          htmlFor="email"
          className="block text-sm font-medium text-gray-700"
        >
          Email Address
        </label>
        <input
          type="email"
          id="email"
          value={formData.email}
          onChange={handleChange}
          className="w-full mt-2 p-3 border border-gray-300 rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
          placeholder="example@mail.com"
        />
      </div>

      {/* Phone Number Field */}
      <div className="mb-6">
        <label
          htmlFor="phone_number"
          className="block text-sm font-medium text-gray-700"
        >
          Phone Number
        </label>
        <input
          type="tel"
          id="phone_number"
          value={formData.phone_number}
          onChange={handleChange}
          className="w-full mt-2 p-3 border border-gray-300 rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
          placeholder="+1234567890"
        />
      </div>

      {/* Submit Button */}
      <div className="mt-8">
        <button
          type="submit"
          className="w-full bg-blue-500 text-white py-3 rounded-lg font-semibold text-lg shadow-md hover:bg-blue-600 transition duration-300"
        >
          Sign Up
        </button>
      </div>
    </form>
    {/* Already have an account */}
    <div className="mt-8 text-center">
      <p className="text-sm text-gray-600">
        Already have an account?{" "}
        <Link
          to="/signin"
          className="text-blue-500 font-medium hover:underline"
        >
          Login
        </Link>
      </p>
    </div>
  </div>

  <div className="flex flex-col items-center justify-center px-4 py-8 sm:px-8 lg:px-16">
      <div className="bg-white shadow-md rounded-lg p-6 max-w-2xl w-full">
        <h1 className="text-2xl font-bold text-center mb-6">
          Terms and Conditions
        </h1>
        <div className="text-gray-700 space-y-4 mb-6">
          <p>
            Welcome to our platform! By accessing or using our services, you
            agree to the following terms and conditions:
          </p>
          <ol className="list-decimal pl-5 space-y-2">
            <li>
              <strong>Use of Service:</strong> You must not misuse our platform
              in any way.
            </li>
            <li>
              <strong>Intellectual Property:</strong> All content on this
              platform is the property of our company.
            </li>
            <li>
              <strong>Privacy Policy:</strong> Please refer to our Privacy
              Policy for more details.
            </li>
            <li>
              <strong>Termination:</strong> We may terminate your access at our
              discretion.
            </li>
            <li>
              <strong>Changes to Terms:</strong> We reserve the right to modify
              these terms at any time.
            </li>
          </ol>
          <p>
            If you have any questions, please contact our support team. Thank
            you for understanding and agreeing to our Terms and Conditions!
          </p>
        </div>
        <div className="flex flex-col items-center">
          <label className="flex items-center mb-4 text-sm text-gray-600">
            <input
              type="checkbox"
              checked={accepted}
              onChange={(e) => setAccepted(e.target.checked)}
              className="mr-2 w-4 h-4 text-blue-500 border-gray-300 rounded focus:ring-blue-400"
            />
            I agree to the Terms and Conditions
          </label>
          <button
            onClick={handleAccept}
            disabled={!accepted}
            className={`px-4 py-2 w-full sm:w-auto bg-blue-500 text-white text-sm font-semibold rounded-lg shadow-md transition duration-200 ${
              accepted
                ? "hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-blue-400 focus:ring-opacity-75"
                : "bg-gray-300 cursor-not-allowed"
            }`}
          >
            Accept
          </button>
        </div>
      </div>
    </div>
</div>


  )
}

export default Signup
